export const CHANGE_DIFFICULTY = 'CHANGE_DIFFICULTY'
export const CHANGE_CARD_TYPE = 'CHANGE_CARD_TYPE'

export const setDif = dif => ({
   type: CHANGE_DIFFICULTY,
    payload: dif
})

export const setType = type => ({
    type: CHANGE_CARD_TYPE,
     payload: type
 })
